 for (var i = 0; i < a.length; i++) {
   n*=a[i];
 }
  return n;
}
function simplify(a,b){
 for (var i = 0; i < a.length; i++) {
   for (var j = 0; j < b.length; j++) {
     if(a[i]==b[j]){
		 //console.log(a[i],b[j],'simplify')
     	a[i]=1;
       	b[j]=1;
		//console.log(a[i],b[j],'simplify - after')
     }
   }
 }
  return [vector_to_num(a),vector_to_num(b)]
}
